/* Function  structure for function  `getRandomString` */

/*!50003 DROP FUNCTION IF EXISTS `getRandomString` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `getRandomString`(n smallint) RETURNS char(255) CHARSET utf8
begin
    declare char_set char(255) default '1234567890ABCDEFGHIGKLMNOPQRSTUVWXYZabcdefghigklmnopqrstuvwxyz';
    declare ret_str char(255) default '';
    declare i int default 0;
    declare len int default 0;
    declare rd int default 0;
    set len = length(char_set);
    while n>0 do
      set rd = floor(1 + rand() * len);
      set ret_str = concat(ret_str, substring(char_set, rd, 1));
      set n = n - 1;
    end while;
    return ret_str;
  end */$$
DELIMITER ;

