/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `batchInsert`(in rowsNum int)
BEGIN
    set autocommit = 0 ;
    while
    rowsNum>0 do
      insert into `adm_test`
      values
        (
          null,
          getRandomString (20),
          getRandomString (200),
          1
        ) ;
      set rowsNum = rowsNum - 1 ;
    end while ;
    commit ;
  END */$$
DELIMITER ;

